import { Route, Switch } from 'react-router-dom';
import "./App.css"
import NavBar from './Components/Navbar';
function App() {

  return (

    <>

    <Navbar />

    <Switch>

      <Route exact path='/' component={Home} />
      <Route path='/hero' component={About} />

    </Switch>


    </>
  )

}

export default App;
